query ItemSessionUserCollections($id: ID!, $itemType: ItemEnum!) {
  item(id: $id, itemType: $itemType) {
    id
    sessionUser {
      collectionIds
    }
  }
}

query CollectionsList($input: CollectionsInput!) {
  collections(input: $input) {
    collections {
      ...CollectionListFields
    }
    pageInfo {
      nextCursor
      hasNextPage
      hasPreviousPage
      previousCursor
    }
  }
}

mutation AddPenToCollection($input: AddPenToCollectionInput!) {
  addPenToCollection(input: $input) {
    collection {
      id
      title
      url
      updatedAt
      counts {
        pens
      }
    }
  }
}

mutation CreateCollection($input: CreateCollectionInput!) {
  createCollection(input: $input) {
    collection {
      ...CollectionListFields
    }
    penId
  }
}

mutation RemovePenFromCollection($input: RemovePenFromCollectionInput!) {
  removePenFromCollection(input: $input) {
    collection {
      id
      title
      url
      counts {
        pens
      }
    }
