    id
    privateByDefault
    title
    contextType
    pro
    teams {
      id
      privateByDefault
      title
      contextType
      ownerId
    }
  }
}

query OwnerPrivateByDefault($ownerId: ID!, $ownerType: ContextEnum!) {
  owner(ownerId: $ownerId, ownerType: $ownerType) {
    id
    privateByDefault
    title
    pro
    ownerType
    avatar80
  }
  sessionUser {
    id
    title
    contextType
    pro
    teams {
      id
      ownerId
    }
  }
}

# Update the setting with this mutation
mutation SetPrivateByDefault(
  $ownerId: ID!
  $ownerType: ContextEnum!
  $privateByDefault: Boolean!
) {
  setPrivateByDefault(
    ownerId: $ownerId
    ownerType: $ownerType
    privateByDefault: $privateByDefault
  ) {
    owner {
      id
      privateByDefault
      ownerType
    }
  }
}
